import React from "react";


function Navigation() {
    return (
        <Navbar.Item href="#">
            <Navbar.Link>Item</Navbar.Link>
            <Navbar.Dropdown>
                <Navbar.Item href="#">Subitem 1</Navbar.Item>
                <Navbar.Item href="#">Subitem 2</Navbar.Item>
            </Navbar.Dropdown>
        </Navbar.Item>
    );
}
export default Navigation;
